{
  "translationLines": [
    {
      "lineNumber": 217972,
      "originalJapaneseLine": "「ばっ！　駄目ー！",
      "translatedEnglishLine": "\"Ba! Nooo!\""
    },
    {
      "lineNumber": 217973,
      "originalJapaneseLine": "　死ぬ気かお前は！」",
      "translatedEnglishLine": "\"Are you trying to kill yourself!\""
    },
    {
      "lineNumber": 217974,
      "originalJapaneseLine": "「けっこー、＜エール＞って好戦的？」",
      "translatedEnglishLine": "\"Are the <Ailes> pretty aggressive?\""
    },
    {
      "lineNumber": 217975,
      "originalJapaneseLine": "「意外と、ね」",
      "translatedEnglishLine": "\"Surprisingly, yeah.\""
    },
    {
      "lineNumber": 217976,
      "originalJapaneseLine": "「うーん、それしかないかぁ」",
      "translatedEnglishLine": "\"Hmm, guess that's the only option.\""
    },
    {
      "lineNumber": 217977,
      "originalJapaneseLine": "「問題はそんな抜け道があるか、だねぇ」",
      "translatedEnglishLine": "\"The problem is whether there's such a loophole or not.\""
    },
    {
      "lineNumber": 217978,
      "originalJapaneseLine": "「ま、普通に考えたら難しいわよね……",
      "translatedEnglishLine": "\"Well, if you think normally, it's difficult...\""
    },
    {
      "lineNumber": 217979,
      "originalJapaneseLine": "　最悪正面突破しかないかも」",
      "translatedEnglishLine": "\"At worst, we might have to break through head-on.\""
    },
    {
      "lineNumber": 217980,
      "originalJapaneseLine": "「通してくれる奴に見えるのかよ、お前には……」",
      "translatedEnglishLine": "\"Do you really look like someone they'll let through...?\""
    },
    {
      "lineNumber": 217981,
      "originalJapaneseLine": "「うーん、でも何日か続ければ、",
      "translatedEnglishLine": "\"Hmm, but if it continues for a few days,\""
    },
    {
      "lineNumber": 217982,
      "originalJapaneseLine": "　向こうも折れてくれるかも知れないよ？」",
      "translatedEnglishLine": "\"maybe they'll give in on the other side?\""
    },
    {
      "lineNumber": 217983,
      "originalJapaneseLine": "「って、あれ？」",
      "translatedEnglishLine": "\"Huh, what's that?\""
    },
    {
      "lineNumber": 217984,
      "originalJapaneseLine": "「ああっ！？　皆さん、大変だす！",
      "translatedEnglishLine": "\"Ah!? Everyone, it's terrible!\""
    },
    {
      "lineNumber": 217985,
      "originalJapaneseLine": "　ざ、ザンス様がいないだす！」",
      "translatedEnglishLine": "\"Z-Zans-sama is missing!\""
    },
    {
      "lineNumber": 217986,
      "originalJapaneseLine": "「ええっ！？」",
      "translatedEnglishLine": "\"Ehh!?\""
    },
    {
      "lineNumber": 217987,
      "originalJapaneseLine": "「嫌な予感しかしないわね……」",
      "translatedEnglishLine": "\"I only have a bad feeling about this...\""
    },
    {
      "lineNumber": 217988,
      "originalJapaneseLine": "「がーーーっはっはっはっはっ！」",
      "translatedEnglishLine": "\"Gahahahaha!\""
    },
    {
      "lineNumber": 217989,
      "originalJapaneseLine": "そのとき、馬鹿笑いの声が響く。",
      "translatedEnglishLine": "At that moment, the sound of loud, foolish laughter echoed."
    },
    {
      "lineNumber": 217990,
      "originalJapaneseLine": "「テメェら、こっちを見ろーーー！」",
      "translatedEnglishLine": "\"You bastards, look this way!\""
    },
    {
      "lineNumber": 217991,
      "originalJapaneseLine": "「ああ、もう……あの馬鹿は……」",
      "translatedEnglishLine": "\"Ah, geez... that idiot...\""
    },
    {
      "lineNumber": 217992,
      "originalJapaneseLine": "「む、なんだ！？」",
      "translatedEnglishLine": "\"Hmm, what!?\""
    },
    {
      "lineNumber": 217993,
      "originalJapaneseLine": "「がはははははははははは！」",
      "translatedEnglishLine": "\"Gahahahahahahaha!\""
    },
    {
      "lineNumber": 217994,
      "originalJapaneseLine": "ザンスが通路に面した家屋の屋根に",
      "translatedEnglishLine": "Zans was standing courageously on the roof of a house facing the passageway."
    },
    {
      "lineNumber": 217995,
      "originalJapaneseLine": "雄々しく立っていた。",
      "translatedEnglishLine": "He stood valiantly."
    },
    {
      "lineNumber": 217996,
      "originalJapaneseLine": "「はん、簡単に上を取られるとは……",
      "translatedEnglishLine": "\"Hmph, to be easily outflanked...\""
    },
    {
      "lineNumber": 217997,
      "originalJapaneseLine": "　テメェら真面目に訓練してたのかぁ〜？」",
      "translatedEnglishLine": "\"You lot were seriously training, huh?\""
    },
    {
      "lineNumber": 217998,
      "originalJapaneseLine": "「あー、ごほんごほん」",
      "translatedEnglishLine": "\"Ahem, cough cough\""
    },
    {
      "lineNumber": 217999,
      "originalJapaneseLine": "「これは最終警告である！」",
      "translatedEnglishLine": "\"This is the final warning!\""
    },
    {
      "lineNumber": 218000,
      "originalJapaneseLine": "「黙って通せば見逃そう！",
      "translatedEnglishLine": "\"If you pass quietly, I'll let you go!\""
    },
    {
      "lineNumber": 218001,
      "originalJapaneseLine": "　だが、徹底抗戦が貴様らの望みならば、",
      "translatedEnglishLine": "\"But if thorough resistance is what you desire,\""
    },
    {
      "lineNumber": 218002,
      "originalJapaneseLine": "　こちらもそれ相応の対応をさせてもらう！」",
      "translatedEnglishLine": "\"we will respond accordingly!\""
    },
    {
      "lineNumber": 218003,
      "originalJapaneseLine": "「我が名はザンス・リーザス！",
      "translatedEnglishLine": "\"My name is Zans Lisas!\""
    },
    {
      "lineNumber": 218004,
      "originalJapaneseLine": "　ゆくゆくはこの世界の王となる男！」",
      "translatedEnglishLine": "\"A man who will eventually become king of this world!\""
    },
    {
      "lineNumber": 218005,
      "originalJapaneseLine": "「俺様の王道を阻む者は誰であろうと……」",
      "translatedEnglishLine": "\"Whoever blocks my royal path...\""
    },
    {
      "lineNumber": 218006,
      "originalJapaneseLine": "「しばき倒す！！！！」",
      "translatedEnglishLine": "\"I will beat down!!!!\""
    },
    {
      "lineNumber": 218007,
      "originalJapaneseLine": "「ふんっ、いい的ではないか！」",
      "translatedEnglishLine": "\"Hmph, a good target, isn't it!\""
    },
    {
      "lineNumber": 218008,
      "originalJapaneseLine": "「全員、構え！！！！」",
      "translatedEnglishLine": "\"Everyone, prepare yourselves!!!!\""
    },
    {
      "lineNumber": 218009,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 218010,
      "originalJapaneseLine": "「放てぇぇえ！」",
      "translatedEnglishLine": "\"Fire!\""
    },
    {
      "lineNumber": 218011,
      "originalJapaneseLine": "「ザンスちゃん！？",
      "translatedEnglishLine": "\"Zans-chan!?\""
    },
    {
      "lineNumber": 218012,
      "originalJapaneseLine": "大量の矢がザンスめがけて放たれる。",
      "translatedEnglishLine": "A large number of arrows were released aimed at Zans."
    },
    {
      "lineNumber": 218013,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 218014,
      "originalJapaneseLine": "「ハッ！　しばき回し決定だ！」",
      "translatedEnglishLine": "\"Ha! It's decided he'll get beaten up!\""
    },
    {
      "lineNumber": 218015,
      "originalJapaneseLine": "その雨のような矢が当たる寸前、",
      "translatedEnglishLine": "Just before the rain-like arrows hit,"
    },
    {
      "lineNumber": 218016,
      "originalJapaneseLine": "ザンスが獰猛な笑みを浮かべた。",
      "translatedEnglishLine": "Zans wore a fierce grin."
    },
    {
      "lineNumber": 218017,
      "originalJapaneseLine": "「フンッ！」",
      "translatedEnglishLine": "\"Hmph!\""
    },
    {
      "lineNumber": 218018,
      "originalJapaneseLine": "ザンスがどこかから引っぺがしてきた",
      "translatedEnglishLine": "Zans tore off"
    },
    {
      "lineNumber": 218019,
      "originalJapaneseLine": "一枚のドアで体を隠した。",
      "translatedEnglishLine": "a door from somewhere and hid behind it."
    },
    {
      "lineNumber": 218020,
      "originalJapaneseLine": "まるでハリネズミのように、",
      "translatedEnglishLine": "Like a hedgehog,"
    },
    {
      "lineNumber": 218021,
      "originalJapaneseLine": "ドアに大量の矢が突き刺さる。",
      "translatedEnglishLine": "a large number of arrows pierced the door."
    },
    {
      "lineNumber": 218022,
      "originalJapaneseLine": "「がはははははははは！",
      "translatedEnglishLine": "\"Gahahahahahaha!"
    },
    {
      "lineNumber": 218023,
      "originalJapaneseLine": "　中々いい腕してんじゃねーか！」",
      "translatedEnglishLine": "You've got quite some skill!\""
    },
    {
      "lineNumber": 218024,
      "originalJapaneseLine": "「どうやらちゃんと戦闘訓練は",
      "translatedEnglishLine": "\"It seems you've been properly training for combat"
    },
    {
      "lineNumber": 218025,
      "originalJapaneseLine": "　してきたようだな！　感心感心！」",
      "translatedEnglishLine": "after all! Impressive, impressive!\""
    },
    {
      "lineNumber": 218026,
      "originalJapaneseLine": "「で、矢はもう終わりか？",
      "translatedEnglishLine": "\"So, are the arrows finished now?"
    },
    {
      "lineNumber": 218027,
      "originalJapaneseLine": "　もう終わりか終わりか！？",
      "translatedEnglishLine": "Is that the end, the end!?\""
    },
    {
      "lineNumber": 218028,
      "originalJapaneseLine": "「がははははは！",
      "translatedEnglishLine": "\"Gahahahaha!"
    },
    {
      "lineNumber": 218029,
      "originalJapaneseLine": "　なら、剣を抜けぇぇええ！」",
      "translatedEnglishLine": "Then, draw your swords!\""
    },
    {
      "lineNumber": 218030,
      "originalJapaneseLine": "「なっ、跳んだ！？",
      "translatedEnglishLine": "\"Wha, he jumped!?\""
    },
    {
      "lineNumber": 218031,
      "originalJapaneseLine": "ザンスがドアを通路に投げ捨て、",
      "translatedEnglishLine": "Zans threw the door into the passageway,"
    }
  ]
}

